<script>
	(function(window){
		var img = document.getElementById('img'),
			isIn = false;

		img.onmouseover = function(e){
			isIn = true;
		}

		img.onmousemove = function(e){
			if(isIn){
				img.style.cssText = '-webkit-mask-position:'+(e.pageX-150)+'px '+(e.pageY-150)+'px;'
			}
		}
		img.onmouseout = function(e){
			isIn = false;
		}
	})(window)
</script>
